(function(){
	var drawCanvas = function(id){
		var ctx = new Canvas(id); // creates a new Canvas object in the canvas with id="ctx"
		ctx.reset();
		for (var i = 0; i<1000; i++){
			var color = 'rgb(0,' + Math.floor(255 - i/7) + ',' +   
                         Math.floor(255 - i/100) + ')';  
			
			ctx.beginPath().line({x:.4*i,y:.4*i,angle: i, distance:i * .40 }).strokeStyle(color).stroke();
		}
		
	};
	
	var drawControl = function(id){
		var canvas = document.getElementById(id);  
		if (canvas.getContext){
			
			var ctx = canvas.getContext('2d');
			for (var i = 0; i<1000; i++){
				var color = 'rgb(' + Math.floor(255 - i/7) + ',' +   
							 Math.floor(255 - i/100) + ',0)',
					hypotenuse = .4 * i,
					angle = i % 360,
					radians = angle * (Math.PI / 180);
					dy = hypotenuse + Math.sin(radians) * hypotenuse,
					dx = hypotenuse + Math.cos(radians) * hypotenuse;
			
				ctx.beginPath();
				ctx.moveTo(hypotenuse, hypotenuse);
				ctx.lineTo(dx,dy);
				ctx.strokeStyle = color;
				ctx.stroke();
			}
			
		}
	};
	
	var controlImage = "data:image/png;base64,";
	startTest('test-2', drawCanvas, drawControl, controlImage);
})();